svg.script:
var urls = {
 BORAT: ['BO Reudnitz-Anger-Crottendorf-Thonberg' ,'/struktur/ortsverbaende/bo_rat/'],
 WEST: ['',''],
 LINXXNET: ['linXXnet','http://www.linke-bueros.de/linxxnet-leipzig.html'],
 BRAUSTR: ['Geschftsstelle/Stadtvorstand','/struktur/stadtvorstand/'],
 SUEDWEST: ['',''],
 SUEDOST: ['',''],
 SUED: ['',''],
 OST: ['',''],
 NORDWEST: ['',''],
 NORDOST: ['',''],
 NORD: ['',''],
 MITTE: ['',''],
 ALTWEST: ['','']
},
textnode = document.getElementById('popup');

var mousein = function(ev) {
 var id = ev.target.id,
 text = urls[id][0];
 textnode.textContent = text;
},
mouseout = function(ev) {
 var id = ev.target.id,
 text = urls[id][0];
 if (textnode.textContent == text) {textnode.textContent = '';}
},
mousecklick = function(ev) {
  var id = ev.target.id,
  url = urls[id][1];
  window.open(url, '_parent');
};

for (var id in urls) {
   document.getElementById(id).addEventListener("mouseout", mouseout);
   document.getElementById(id).addEventListener("mouseenter", mousein);
   document.getElementById(id).addEventListener("click", mousecklick);
}
